position_description_2:
I have almost 30 years of combined experience in the areas of Project Management, Program Management, Telecommunications, Electrical, Voice and Data and Senior IT Project Management experience, including Estimating and Operations experience. Some of my past PMO and IT Project Management experience includes:

3 Years Gaming / Hospitality Experience; including the $128M Pervasive WiFi Project for Caesars Entertainment, the $150M Graton Hotel and Resort, the $14M SONIFI IRE Project for Caesars Entertainment.

5 Years Deputy Design Manager and 1.5 Years Construction Management Experience on MTA/NYCT, NYPD and FDNY Radio Communications Projects including SCADA and MCAS (Project Portfolio $550M);

2yrs Senior IT Project Manager, Pacific Gas and Electric, MRTU Program, SCADA Rollout on both Gas and Electric Transmission and Distribution side. 

At PG&E I had 28 Projects, half were Electric Substations, the others Corporate Real Estate (CRE) and MRTU – all projects completed on Time and on Budget. (Overall Project Portfolio $160M);

10 Years of concurrent Data and Command Center experience, both  Project Management and Construction Management; 

Projects included PG&E’s Energy Procurement Back Up Command Center in Vacaville (8000 Square Feet); 

MTA/NYCT RTO Rail Command Center in Manhattan (90,000 Square Feet); 

NYCT Department of Buses (DoB) 35,000 square foot Command Center in Brooklyn, just to name a few.

5 Years of Voice/Data Estimating Experience, including 2 Years at Compel Corporation, where we bid against SASCO, Helix and Rex Moore, amongst others.

Contracted Project Manager at: Henkels and McCoy, Pacific Coast Cabling, Semans and other contractors in CA;

CA State Contractors License holder – C7 – Low Voltage and Data Systems

Former contractor to high end AV Vendor www.bradfordwells.com, etc.....

summary:
Security Professional with 15+ years of experience in managing all aspects of Public Key Infrastructure (PKI) in a large scale enterprise environment (100,000+ users).

Extensive knowledge in designing, deploying & managing multi-vendor solutions:
On-Prem Certificate Authority solutions like Microsoft Active Directory Certificate Services (ADCS) & Entrust Certificate Authority;
Enterprise key life cycle management solution via Keyfactor Command;
Enterprise scale Code Signing service backed by FIPS 140-2 Level 3 Hardware Security Modules (HSMs);
On-Prem & Azure Information Rights Management solution (IRM/RMS).
